import React from 'react';
import { Col, Row, Button, Form } from 'react-bootstrap';

import {Box} from '../../components/Box/Box.js';

const ChatPage = () => {
    return(
        <>
            <Col>
                <Row>
                    <Box style={{width: "550px", height: "450px"}} text="PT Video" />
                </Row>
                <br></br>
                <Row>
                    <Box style={{width: "550px", height: "450px"}} text="Patient Video" />
                </Row>
            </Col>
            <Col>
                <Box />
            </Col>
        </>
    );
}

export default ChatPage;
